import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button, Container } from 'react-bootstrap';

import AppContext from './libs/contextLib';
import { Switch, BrowserRouter as Router, Redirect, useParams, Route } from 'react-router-dom';
import LoginPage from './LoginPage';
import Navmenu from './NavMenu';
export default function App() {
    const [isAuthenticated, setIsAuthenticated] = useState(false);
    const [isloading, setIsLoading] = useState(true);
    const [userData, setUserData] = useState({});
    const handleLogout = () => {
        setIsAuthenticated(false);
        localStorage.setItem('userdata', '');
    }

    const Home = () => {
        return (
            <>

                <Container>
                    <div className='row bg-light p-5 my-5 rounded'>
                        <div className='col-md-12 text-center'>
                            {isAuthenticated ? (
                                <p>Welcome </p>
                            ) : (
                                    <LoginPage />
                                )}
                        </div>
                    </div>
                </Container>
            </>
        );
    }

    const NotFound = () => {
        return (
            <>
                <Navmenu />
                <div className='row bg-light p-5 my-5 rounded'>
                    <div className='col-md-12 text-center'>
                        <p>Sorry 404</p>
                    </div>
                </div>
            </>
        );
    }

    const QuizMain = () => {
        const { video_url } = useParams();
    }
    return (
        <AppContext.Provider value={{ isAuthenticated, setIsAuthenticated, userData, setUserData }}>
            <Navmenu handleLogout={handleLogout} />
            <Container className="containerMain">
                <Router>
                    <Switch>
                        <Route exact path="/" component={Home} />
                        <Route path="/dw-video/:video_url" children={<QuizMain />} />
                        <Route component={NotFound} />
                    </Switch>
                </Router>
            </Container>
        </AppContext.Provider>
    );
}
